template <size_t Depth>
uint256 insertAndTestConsistency(
                              IncrementalMerkleTree& oldTree,
                              NewTree::IncrementalMerkleTree<Depth, NewTree::SHA256Compress>& newTree,
                              uint256 value)
{
    {
        std::vector<unsigned char> index;
        std::vector<unsigned char> valueVec(value.begin(), value.end());

        oldTree.insertElement(valueVec, index);
    }

    NewTree::SHA256Compress shc(value);

    newTree.append(shc);

    NewTree::SHA256Compress newRoot = newTree.root();
    uint256 rt(newRoot);

    std::vector<unsigned char> oldRoot(32, 0x00);
    oldTree.getRootValue(oldRoot);
    uint256 rt2(oldRoot);

    BOOST_CHECK_MESSAGE(rt == rt2, "new: " + HexStr(rt.begin(), rt.end()) + "; old: " + HexStr(rt2.begin(), rt2.end()));

    CDataStream ss(SER_DISK, 0);

    ss << newTree;

    BOOST_CHECK(ss.size() == newTree.GetSerializeSize(0, 0));

    //std::cout << "Serialized data: " << HexStr(ss.begin(), ss.end()) << std::endl;

    NewTree::IncrementalMerkleTree<20, NewTree::SHA256Compress> detree;

    ss >> detree;

    NewTree::SHA256Compress deroot = detree.root();
    uint256 rt3(deroot);

    BOOST_CHECK_MESSAGE(rt == rt3, "original: " + HexStr(rt.begin(), rt.end()) + "; deserialized: " + HexStr(rt3.begin(), rt3.end()));

    // test the copy/move/assignment operations
    newTree = detree;

    return rt;
}

void testPathCalculation(size_t before, size_t after) {
    IncrementalMerkleTree oldTree(20);
    NewTree::IncrementalMerkleTree<20, NewTree::SHA256Compress> newTree;

    NewTree::IncrementalWitness<20, NewTree::SHA256Compress> *witness = nullptr;
    std::vector<bool> indexFinal;

    for (int i = 0; i < before + after; i++) {
        uint256 value = uint256S("fa51fd49abf67705d6a35d18218c115ff5633aec1f9ebfdc9d5d4956416f57f6");
        {
            std::vector<bool> index;
            std::vector<unsigned char> valueVec(value.begin(), value.end());
            std::vector<bool> valueVecBool;
            convertBytesVectorToVector(valueVec, valueVecBool);

            oldTree.insertElement(valueVecBool, index);

            if (i == before) {
                indexFinal = index;
            }
        }

        newTree.append(value);

        if (witness) {
            witness->append(value);
        }

        if (i == before) {
            witness = new NewTree::IncrementalWitness<20, NewTree::SHA256Compress>(newTree);
        }
    }

    BOOST_CHECK(witness->root() == newTree.root());
    {
        std::vector<unsigned char> oldRoot(32, 0x00);
        oldTree.getRootValue(oldRoot);
        uint256 rt(oldRoot);
        BOOST_CHECK(witness->root() == rt);
    }

    auto wit = witness->path();
    merkle_authentication_path oldWit;
    oldTree.getWitness(indexFinal, oldWit);

    BOOST_CHECK(oldWit == wit.authentication_path);
    BOOST_CHECK(indexFinal == wit.index);
}

BOOST_AUTO_TEST_CASE( checkPathComputation ) {
    for (int i = 0; i < 12; i++) {
        for (int j = 12-i; j > 0; j--) {
            testPathCalculation(i, j);
        }
    }   
}

BOOST_AUTO_TEST_CASE ( checkCompletness ) {
    NewTree::IncrementalMerkleTree<3, NewTree::SHA256Compress> newTree;

    for (size_t i = 0; i < 8; i++) {
        BOOST_CHECK(!newTree.is_complete());
        newTree.append(uint256());
    }

    BOOST_CHECK(newTree.is_complete());
}

BOOST_AUTO_TEST_CASE ( checkWitnessAppend ) {
    for (size_t i = 0; i < 8; i++) {
        NewTree::IncrementalMerkleTree<3, NewTree::SHA256Compress> newTree;

        for (size_t o = 0; o < i; o++) {
            newTree.append(uint256S("fa51fd49abf67705d6a35d18218c115ff5633aec1f9ebfdc9d5d4956416f57f6"));
        }

        NewTree::IncrementalWitness<3, NewTree::SHA256Compress> witness(newTree);
        BOOST_CHECK(newTree.root() == witness.root());

        for (size_t j = i; j < 8; j++) {
            newTree.append(uint256S("fa51fd49abf67705d6a35d18218c115ff5633aec1f9ebfdc9d5d4956416f57f6"));
            witness.append(uint256S("fa51fd49abf67705d6a35d18218c115ff5633aec1f9ebfdc9d5d4956416f57f6"));

            BOOST_CHECK(newTree.root() == witness.root());
        }
    }
}

BOOST_AUTO_TEST_CASE( checkIncompleteDepth ) {
    NewTree::IncrementalMerkleTree<3, NewTree::SHA256Compress> newTree;

    // Challenge: generate this test vector algebraically for arbitrary
    // depths
    std::vector<std::vector<size_t>> test = {
        {0, 0, 1, 2, 3},
        {0, 1, 2, 3},
        {1, 2, 3},
        {0, 2, 3},
        {2, 3},
        {0, 1, 3},
        {1, 3},
        {0, 3},
        {3}
    };

    BOOST_FOREACH(const std::vector<size_t> depths, test)
    {
        size_t skip = 0;
        BOOST_FOREACH(const size_t depth, depths)
        {
            BOOST_CHECK(depth == newTree.next_depth(skip));
            skip++;
        }

        newTree.append(uint256());
    }
}

